import React from 'react';

const productList = [
  {
    id: 1,
    name: 'Sword Tail',
    quantity: 10,
    price: 500,
    description: 'A healthy and good looking ornamental fish worth the money.',
    imageUrl: 'https://www.petguide.com/wp-content/uploads/2013/11/swordtail-fish.jpg'
  }
];
const products = () => {
    return (
      <div>
      {/* Header */}
      <nav className="navbar navbar-light bg-light">
        <div className="container-fluid">
          <a className="navbar-brand">DO AQUA FISHES</a>
          <form className="d-flex">
            <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
            <button className="btn btn-outline-success" type="submit">Search</button>
          </form>
        </div>
      </nav>
      {/* List of products */}
      <h2>Products</h2>
      {
        productList.map((prod, index)=>{
          return(
            <div key={index} className="card" style={{width: "18rem"}}>
              <img src={prod.imageUrl} className="card-img-top" />
              <div className="card-body">
                <h5 className="card-title">{prod.name}</h5>
                <p className="card-text">{prod.description}</p>
                <p className="card-text">{prod.quantity} stocks left.</p>
                <a href="#" className="btn btn-primary">Edit</a>
                <a href="#" className="btn btn-primary">Delete</a>
              </div>
            </div>
          )
        })
      }
      </div>

    );
};


export default products;
